import React from 'react';
import './about.css';

function About() {
  return (
    <section id="about">
      <div className="about-container">
        <h1>About Me</h1>

        <div className="about-content">
          <p>Hey, I'm Reece! ðŸ‘‹</p>
          <p>
            I'm a Machine Learning Engineer currently working at TerraSense Analytics. My interests
            and work lie in teaching computers about visual concepts in the real world. Currently,
            I'm focusing on training a computer to understand what something is and where it might be
            within a given image or video. During idle time, I like tinkering with Linux systems,
            dabbling in task automation, and exploring web technologies.
          </p>
          <p>
            On this page you can find out a bit more about me, some of my past projects (mostly open
            source), and my other interests.
          </p>
        </div>
      </div>
    </section>
  );
}

export default About;
